import logo from './logo.svg';
import './App.css';
import { CookiesProvider } from "react-cookie";
import Stack from '@mui/material/Stack';
import SigninModal from './Components/Signin/SigninModal.js';
import SignupModal from './Components/Signup/SignupModal.js';
import SignupForm from './Components/Signup/SignupForm.js';
import SignInForm from './Components/Signin/SignInForm.js';

function App() {
  return (
    <div className="App">
      <CookiesProvider>
        <Stack direction="row" spacing={2}>
          <SigninModal title={'Sign In'}/>
          <SignupModal title={'Sign Up'}/>
        </Stack>
      </CookiesProvider>
    </div>
  );
}

export default App;
